import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './My Components/Navbar';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/checkout" />
          <Route path="/login" />
          <Route path="/" element={<Navbar />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
